import{_ as e,o as r,c as t,O as a}from"./chunks/framework.6305ff1a.js";const f=JSON.parse('{"title":"1111","description":"","frontmatter":{},"headers":[],"relativePath":"record-2021/11/1111.md","filePath":"record-2021/11/1111.md"}'),p={name:"record-2021/11/1111.md"},o=a('<h1 id="_1111" tabindex="-1">1111 <a class="header-anchor" href="#_1111" aria-label="Permalink to &quot;1111&quot;">​</a></h1><p><img src="http://h2.ioliu.cn/bing/BlackSun_ZH-CN0889682619_1920x1080.jpg" alt=""></p><h2 id="工作" tabindex="-1">工作 <a class="header-anchor" href="#工作" aria-label="Permalink to &quot;工作&quot;">​</a></h2><p>今天 leader 找我谈了阶段性的职业规划，即对照公司的职级体系，我当前所处在的位置，以及我未来将要达到的位置，接下来该做的事情等等。</p><p>总结来说：</p><ul><li>保质保量把后续开发完成好，追求 0 bug 提测上线；</li><li>主动性：发现产品或项目的问题和不足，主动提出告知产品和测试，并能够独立解决完善；</li><li>学习：通过书籍，博客、视频等学习资料，提升自己的综合能力；书读百遍，其义自见，因此故书重读，总结消化，转变为自己的能力和素养；</li></ul><p><strong>有意思的事情</strong></p><p>群里有人分享了一篇以言情小说的方式写的 JavaScript 教程：<a href="https://m.zhangyue.com/readbook/12567484/5.html?showDownload=1" target="_blank" rel="noreferrer">JavaScript百炼成仙</a></p><h2 id="今日算法" tabindex="-1">今日算法 <a class="header-anchor" href="#今日算法" aria-label="Permalink to &quot;今日算法&quot;">​</a></h2><p>今日学习：</p><ul><li>454 四数相加 II</li><li>11 盛最多水的容器</li><li>289 生命游戏</li></ul><p>今日复习：</p><ul><li>234 回文链表</li></ul><h2 id="温故知新" tabindex="-1">温故知新 <a class="header-anchor" href="#温故知新" aria-label="Permalink to &quot;温故知新&quot;">​</a></h2><blockquote><p>防抖节流等各种手写，http和网络，浏览器原理，性能优化，Webpack</p></blockquote><h2 id="好文推荐" tabindex="-1">好文推荐 <a class="header-anchor" href="#好文推荐" aria-label="Permalink to &quot;好文推荐&quot;">​</a></h2><blockquote><p>有感好文</p></blockquote><ul><li><a href="https://juejin.cn/post/6924368956950052877" target="_blank" rel="noreferrer">实现Web端自定义截屏</a></li><li><a href="https://www.anquanke.com/member.html?memberId=161290" target="_blank" rel="noreferrer">V8原理解析</a> V8原理解析，当前已经写了19篇了</li><li><a href="https://mp.weixin.qq.com/s/6sskeHZOgcx8w2rZDd0GKw" target="_blank" rel="noreferrer">5 年前端经验的大佬提供的职业规划</a></li></ul><blockquote><p>总结—— 《5 年前端经验的大佬提供的职业规划》</p></blockquote><p>1.大前端 是未来的一个趋势，将最终目标（提升用户体验）一致的技术归类到一起，让开发者清楚自己的最终目标是什么，要怎么做。当然，也正因为这点，作为一个前端工程师，如果你想更好的发展，你应该有更广的知识面，包括移动端知识、服务端知识。这些知识结合你的前端技术，才能更好地实现优秀的用户体验。</p><p>2.前端另一大现状就是 —— 移动为先。原因很简单，随着移动互联网用户的暴涨，各个公司的产品都是移动为先，技术跟随着产品的步伐，也必须移动为先。这时，为了解决多平台的问题，Hybrid 方案脱颖而出，包括传统的基于 WebView 的 Hybrid 方案（例如 Cordova）和 React-Native 等一系列技术方案。</p><p>3.选定未来的方向：技术专家(架构师)/技术经理。秉承 【一万小时定律】坚持学习和输出，鞭策自己达到目标。</p><h2 id="项目推荐" tabindex="-1">项目推荐 <a class="header-anchor" href="#项目推荐" aria-label="Permalink to &quot;项目推荐&quot;">​</a></h2><blockquote><p>值得学习的项目</p></blockquote><ul><li><a href="https://juejin.cn/post/7021358536504393741" target="_blank" rel="noreferrer">umi3教程(看完没入门就来打我)</a></li><li><a href="https://juejin.cn/post/7013606537100787748" target="_blank" rel="noreferrer">webpack5长文，带你从零搭建一个项目</a></li></ul><p>上面 2 篇文章都是同一个作者写的，有空可以一步一步跟着做看看</p><h2 id="面经相关" tabindex="-1">面经相关 <a class="header-anchor" href="#面经相关" aria-label="Permalink to &quot;面经相关&quot;">​</a></h2><blockquote><p>八股文相关</p></blockquote><ul><li><a href="https://github.com/yifeikong/reverse-interview-zh" target="_blank" rel="noreferrer">如何反问面试官</a></li></ul><p><strong>八个笔试 &amp; 面试仓库</strong></p><p>1.Front-end Developer Interview Questions 网址：<a href="https://h5bp.org/Front-end-Developer-Interview-Questions/" target="_blank" rel="noreferrer">https://h5bp.org/Front-end-Developer-Interview-Questions/</a></p><p>2.CS-Interview-knowledge-Map 网址：<a href="https://github.com/InterviewMap/CS-Interview-Knowledge-Map" target="_blank" rel="noreferrer">https://github.com/InterviewMap/CS-Interview-Knowledge-Map</a></p><p>3.Daily-Question 网址：<a href="https://github.com/shfshanyue/Daily-Question" target="_blank" rel="noreferrer">https://github.com/shfshanyue/Daily-Question</a></p><p>4.Daily-Interview-Question 网址：<a href="https://github.com/Advanced-Frontend/Daily-Interview-Question" target="_blank" rel="noreferrer">https://github.com/Advanced-Frontend/Daily-Interview-Question</a></p><p>5.fe-interview 大前端面试宝典 网址：<a href="https://lucifer.ren/fe-interview" target="_blank" rel="noreferrer">https://lucifer.ren/fe-interview</a></p><p>6.前端硬核面试专题 网址：<a href="https://github.com/biaochenxuying/blog/blob/master/interview/fe-interview.md" target="_blank" rel="noreferrer">https://github.com/biaochenxuying/blog/blob/master/interview/fe-interview.md</a></p><p>7.LeetCode 算法试题学习 网址：<a href="https://leetcode-cn.com/problemset/all" target="_blank" rel="noreferrer">https://leetcode-cn.com/problemset/all</a></p><p>8.LeetCode 算法试题学习 网址：<a href="https://www.nowcoder.com/%E2%80%8B" target="_blank" rel="noreferrer">https://www.nowcoder.com/​</a></p><p><strong>其他面试语录：</strong></p><p>Q: 你们使用那些第三方依赖？</p><p>A: webpack-bundler-analyzer</p><p>Q: 那你说一说你是如何依赖它优化项目体积的</p><p>A: eslint/prettier/stylelint</p><p>Q: 那你们项目时如何更好的格式化校验的，如果有人不遵循规则怎么样</p><p>A: git hooks</p><p>Q: 如果 git commit --no-verify 跳过怎么办</p><p>A: CI</p><p>Q: 如果你们的 eslint 是后加上去的，每次只想对更新代码做校验如何处理</p><p>Q: 你们 CI 还做了写什么事情</p><p>Q: 你们的上线流程是什么样子的</p><p>Q: ...</p><p>A: exif-js，用以读取当前照片时横向还是纵向</p><p>Q: 什么是 EXIF</p><p>A: 嵌在 JPEG 中的元数据，有光圈、曝光度、GPS...</p><p>Q: 读取的原理是什么</p><p>Q: 为了优化图片，是否可以把 EXIF 给抹去</p><p>A: clipboard.js</p><p>Q: 你说下剪切板上如何复制内容</p><p>A: ...</p><p>Q: 如果想要复制 HTML 带有格式的呢</p><p>A: xxxxx，我们内部的一个依赖库</p><p>Q: 如何引入私有库</p><p>Q: 你们私有库有没有单独的 npm 仓库</p><p>Q: 这个私有库是做什么的，你有没有参与工作</p><p>Q: ...</p><p>A: nodeemail</p><p>A: juice</p><p>A: remark</p><p>A: ...</p>',69),l=[o];function i(n,h,s,c,u,b){return r(),t("div",null,l)}const m=e(p,[["render",i]]);export{f as __pageData,m as default};
